      GPA: '3.9',
      school: 'Ivane Javakhishvili Tbilisi State University',
      location: 'Tbilisi, Georgia',
    },
    {
      degree: 'Bachelor of Mathematics',
      program: 'Computer Science and Mathematics',
      GPA: '3.9',
      school: 'Ivane Javakhishvili Tbilisi State University',
      location: 'Tbilisi, Georgia',
    },
    {
      degree: 'Columbia Engineering Boot Camps',
      program: 'AI',
      date: 'November 2023 - Current',
      location: 'New York, NY',
    },
    {
      degree: 'Certified AWS practitioner',
      organization: 'Per Scholas',
      date: 'September 2022',
      certifications: [
        'S3', 'EC2', 'Redshift', 'Glue', 'QuickSight', 'Lambda', 'SageMaker',
      ],
    },
    // Add more education data here
  ];

  return (
    <div className='education'>
      <h3>EDUCATION and CERTIFICATIONS</h3>
      {educationData.map((entry, index) => (
        <div key={index}>
          {/* Render the education data here */}
        </div>
      ))}
    </div>
  );
}

export default Education;
